import { Box, Heading, HStack, Image, Spacer, Stack } from "@chakra-ui/react";

const Home = () => {
  return (
    <Stack spacing="40%" ml="10" direction="row">
      <Heading mt="15%" as="h1">
        the best casting agent
      </Heading>
      <Box>
        <Image
          mt="50%"
          boxSize="600px"
          objectFit="contain"
          src="pana.png"
        ></Image>
      </Box>
    </Stack>
  );
};

export default Home;
